-- CREATE SCHEMA "OMS_ZF";

CREATE TABLE "OMS_ZF"."DEVICE"
(
    "ID" VARCHAR2(50) NOT NULL,
    "CHILD_ID" VARCHAR2(50),
    "NAME" VARCHAR2(255),
    "VOLTAGE" VARCHAR2(50),
    "TYPE" VARCHAR2(255),
    "PATTERN_ID" VARCHAR2(255)
);
COMMENT ON TABLE "OMS_ZF"."DEVICE" IS '设备信息表';
COMMENT ON COLUMN "OMS_ZF"."DEVICE"."CHILD_ID" IS '子设备id';
COMMENT ON COLUMN "OMS_ZF"."DEVICE"."ID" IS '设备Id';
COMMENT ON COLUMN "OMS_ZF"."DEVICE"."NAME" IS '设备名称';
COMMENT ON COLUMN "OMS_ZF"."DEVICE"."PATTERN_ID" IS '正则id';
COMMENT ON COLUMN "OMS_ZF"."DEVICE"."TYPE" IS '设备类型';
COMMENT ON COLUMN "OMS_ZF"."DEVICE"."VOLTAGE" IS '电压';



CREATE TABLE "OMS_ZF"."DEVICE_SCADA_INFO_TYPE"
(
    "ID" VARCHAR2(50) NOT NULL,
    "DEVICE_ID" VARCHAR2(50),
    "NAME" VARCHAR2(255),
    "UPLOAD" TINYINT,
    "MASTER_MERGE" TINYINT,
    "PRIORITY" SMALLINT,
    "PATTERN_ID" VARCHAR2(255),
    "COMMENT" VARCHAR2(255),
    "INCLUDE_DEVICE_NAME" TINYINT,
    "FULL_TEXT_MATCH" TINYINT
);
COMMENT ON TABLE "OMS_ZF"."DEVICE_SCADA_INFO_TYPE" IS '设备监控信息类型表';
COMMENT ON COLUMN "OMS_ZF"."DEVICE_SCADA_INFO_TYPE"."COMMENT" IS '备注';
COMMENT ON COLUMN "OMS_ZF"."DEVICE_SCADA_INFO_TYPE"."DEVICE_ID" IS '校验规则类型所属设备id';
COMMENT ON COLUMN "OMS_ZF"."DEVICE_SCADA_INFO_TYPE"."FULL_TEXT_MATCH" IS '是否全文匹配';
COMMENT ON COLUMN "OMS_ZF"."DEVICE_SCADA_INFO_TYPE"."ID" IS '校验规则类型id';
COMMENT ON COLUMN "OMS_ZF"."DEVICE_SCADA_INFO_TYPE"."INCLUDE_DEVICE_NAME" IS '是否包含设备名';
COMMENT ON COLUMN "OMS_ZF"."DEVICE_SCADA_INFO_TYPE"."MASTER_MERGE" IS '是否主站合并';
COMMENT ON COLUMN "OMS_ZF"."DEVICE_SCADA_INFO_TYPE"."NAME" IS '校验规则类型名称';
COMMENT ON COLUMN "OMS_ZF"."DEVICE_SCADA_INFO_TYPE"."PATTERN_ID" IS '校验规则类型正则id';
COMMENT ON COLUMN "OMS_ZF"."DEVICE_SCADA_INFO_TYPE"."PRIORITY" IS '优先级';
COMMENT ON COLUMN "OMS_ZF"."DEVICE_SCADA_INFO_TYPE"."UPLOAD" IS '是否上传';



CREATE TABLE "OMS_ZF"."DEVICE_SCADA_INFO_RULE"
(
    "ID" VARCHAR2(50) NOT NULL,
    "DEVICE_SCADA_INFO_TYPE_ID" VARCHAR2(50),
    "NAME" VARCHAR2(255),
    "RULE" VARCHAR2(255),
    "PATTERN_ID" VARCHAR2(255),
    "INCLUDE_DEVICE_NAME" TINYINT,
    "FULL_TEXT_MATCH" TINYINT
);
COMMENT ON TABLE "OMS_ZF"."DEVICE_SCADA_INFO_RULE" IS '设备监控信息正则表';
COMMENT ON COLUMN "OMS_ZF"."DEVICE_SCADA_INFO_RULE"."DEVICE_SCADA_INFO_TYPE_ID" IS '校验规则类型Id';
COMMENT ON COLUMN "OMS_ZF"."DEVICE_SCADA_INFO_RULE"."FULL_TEXT_MATCH" IS '是否全文本校验';
COMMENT ON COLUMN "OMS_ZF"."DEVICE_SCADA_INFO_RULE"."ID" IS '校验规则id';
COMMENT ON COLUMN "OMS_ZF"."DEVICE_SCADA_INFO_RULE"."INCLUDE_DEVICE_NAME" IS '校验时是否包含设备名';
COMMENT ON COLUMN "OMS_ZF"."DEVICE_SCADA_INFO_RULE"."NAME" IS '校验规则名称';
COMMENT ON COLUMN "OMS_ZF"."DEVICE_SCADA_INFO_RULE"."PATTERN_ID" IS '校验规则正则id';
COMMENT ON COLUMN "OMS_ZF"."DEVICE_SCADA_INFO_RULE"."RULE" IS '校验规则';



CREATE TABLE "OMS_ZF"."DEVICE_SCADA_REGEX"
(
    "ID" VARCHAR2(50) NOT NULL,
    "PATTERN" VARCHAR2(255),
    "NOT_MATCH_MESSAGE" VARCHAR2(255)
);
COMMENT ON COLUMN "OMS_ZF"."DEVICE_SCADA_REGEX"."ID" IS '正则id';
COMMENT ON COLUMN "OMS_ZF"."DEVICE_SCADA_REGEX"."NOT_MATCH_MESSAGE" IS '未匹配时显示信息';
COMMENT ON COLUMN "OMS_ZF"."DEVICE_SCADA_REGEX"."PATTERN" IS '正则表达式';

